import './App.css';

import {
  Routes,
  BrowserRouter as Router,
  Route,
} from "react-router-dom";
import {Home} from "./pages/home";
import {Login} from "./pages/login";



function App() {
  return (
      <Router>
        <Routes>
          <Route path={"/"}>
            <Home/>
          </Route>
          <Route path={"/login"}>
            <Login/>
          </Route>
        </Routes>
      </Router>

  );
}

export default App;
